import React, { useState, useEffect } from 'react';
import './ContractInput.css';

/**
 * Component for handling contract input in the Bridge game
 * @param {Object} props - Component props
 * @param {Function} props.onContractChange - Function to handle contract changes
 * @param {String} props.initialContract - Initial contract value
 */
const ContractInput = ({ onContractChange, initialContract }) => {
  // States for each contract component
  const [level, setLevel] = useState('');
  const [suit, setSuit] = useState('');
  const [declarer, setDeclarer] = useState('');
  const [doubled, setDoubled] = useState('');
  
  // Initialize contract if provided
  useEffect(() => {
    if (initialContract) {
      const contractMatch = initialContract.match(/(\d)([♣♦♥♠]|NT)\s+([NESW])(X{0,2})/);
      if (contractMatch) {
        setLevel(contractMatch[1]);
        setSuit(contractMatch[2]);
        setDeclarer(contractMatch[3]);
        setDoubled(contractMatch[4] || '');
      }
    } else {
      // Reset the contract inputs
      setLevel('');
      setSuit('');
      setDeclarer('');
      setDoubled('');
    }
  }, [initialContract]);
  
  // Update contract when any component changes
  useEffect(() => {
    if (level && suit && declarer) {
      const contractString = `${level}${suit} ${declarer}${doubled}`;
      onContractChange(contractString);
    }
  }, [level, suit, declarer, doubled, onContractChange]);
  
  // Handle level selection
  const handleLevelSelect = (selectedLevel) => {
    setLevel(selectedLevel);
  };
  
  // Handle suit selection
  const handleSuitSelect = (selectedSuit) => {
    setSuit(selectedSuit);
  };
  
  // Handle declarer selection
  const handleDeclarerSelect = (selectedDeclarer) => {
    setDeclarer(selectedDeclarer);
  };
  
  // Handle doubled selection
  const handleDoubledSelect = (selectedDoubled) => {
    setDoubled(selectedDoubled);
  };
  
  // Check if button is selected for highlighting
  const isSelected = (type, value) => {
    switch (type) {
      case 'level':
        return level === value;
      case 'suit':
        return suit === value;
      case 'declarer':
        return declarer === value;
      case 'doubled':
        return doubled === value;
      default:
        return false;
    }
  };
  
  return (
    <div className="contract-input">
      <div className="input-label">Contract:</div>
      
      <div className="input-section">
        <div className="section-label">Level</div>
        <div className="button-grid">
          {[1, 2, 3, 4, 5, 6, 7].map(num => (
            <button
              key={`level-${num}`}
              className={`contract-btn level-btn ${isSelected('level', String(num)) ? 'selected' : ''}`}
              onClick={() => handleLevelSelect(String(num))}
            >
              {num}
            </button>
          ))}
        </div>
      </div>
      
      <div className="input-section">
        <div className="section-label">Suit</div>
        <div className="button-grid">
          <button
            className={`contract-btn suit-btn clubs ${isSelected('suit', '♣') ? 'selected' : ''}`}
            onClick={() => handleSuitSelect('♣')}
          >
            ♣
          </button>
          <button
            className={`contract-btn suit-btn diamonds ${isSelected('suit', '♦') ? 'selected' : ''}`}
            onClick={() => handleSuitSelect('♦')}
          >
            ♦
          </button>
          <button
            className={`contract-btn suit-btn hearts ${isSelected('suit', '♥') ? 'selected' : ''}`}
            onClick={() => handleSuitSelect('♥')}
          >
            ♥
          </button>
          <button
            className={`contract-btn suit-btn spades ${isSelected('suit', '♠') ? 'selected' : ''}`}
            onClick={() => handleSuitSelect('♠')}
          >
            ♠
          </button>
          <button
            className={`contract-btn suit-btn nt ${isSelected('suit', 'NT') ? 'selected' : ''}`}
            onClick={() => handleSuitSelect('NT')}
          >
            NT
          </button>
        </div>
      </div>
      
      <div className="input-section">
        <div className="section-label">Declarer</div>
        <div className="button-grid">
          <button
            className={`contract-btn declarer-btn ${isSelected('declarer', 'N') ? 'selected' : ''}`}
            onClick={() => handleDeclarerSelect('N')}
          >
            N
          </button>
          <button
            className={`contract-btn declarer-btn ${isSelected('declarer', 'E') ? 'selected' : ''}`}
            onClick={() => handleDeclarerSelect('E')}
          >
            E
          </button>
          <button
            className={`contract-btn declarer-btn ${isSelected('declarer', 'S') ? 'selected' : ''}`}
            onClick={() => handleDeclarerSelect('S')}
          >
            S
          </button>
          <button
            className={`contract-btn declarer-btn ${isSelected('declarer', 'W') ? 'selected' : ''}`}
            onClick={() => handleDeclarerSelect('W')}
          >
            W
          </button>
        </div>
      </div>
      
      <div className="input-section">
        <div className="section-label">Doubled</div>
        <div className="button-grid">
          <button
            className={`contract-btn doubled-btn ${isSelected('doubled', '') ? 'selected' : ''}`}
            onClick={() => handleDoubledSelect('')}
          >
            -
          </button>
          <button
            className={`contract-btn doubled-btn ${isSelected('doubled', 'X') ? 'selected' : ''}`}
            onClick={() => handleDoubledSelect('X')}
          >
            X
          </button>
          <button
            className={`contract-btn doubled-btn ${isSelected('doubled', 'XX') ? 'selected' : ''}`}
            onClick={() => handleDoubledSelect('XX')}
          >
            XX
          </button>
        </div>
      </div>
    </div>
  );
};

export default ContractInput;
